function obliczStawke(){var e=parseFloat(document.getElementById("graficzne").value),a=parseFloat(document.getElementById("zarzadzanie").value),t=parseFloat(document.getElementById("programistyczne").value);isNaN(e)&&(e=0),isNaN(a)&&(a=0),isNaN(t)&&(t=0);var n=50*e+70*a+90*t;document.getElementById("wynik").innerHTML=n.toFixed(2)}